Чё там по краху российской экономики?

— AMD и Intel приостановили поставки своей продукции на территорию России. Ранее то же самое сделала Dell;
— Евросоюз заморозит активы Центробанка России. Поддерживать рубль смогут только скрепы;
— Евросоюз заморозит активы российских бизнесменов;
— От SWIFT отключат как минимум все банки, которые уже попали под санкции;
— «Золотые паспорта» – В С Ё. Теперь нельзя получить европейское гражданство в обмен на инвестиции.

